// F:\landinghub-iconic\apps\web\src\pages\UserDashboardContent.js
import React, { useState, useEffect } from 'react';
import api from '@landinghub/api';

const UserDashboardContent = () => {
    const [pages, setPages] = useState([]);
    const [leads, setLeads] = useState([]);
    const [reports, setReports] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const pagesRes = await api.get('/api/pages');
                const leadsRes = await api.get('/api/leads');
                const reportsRes = await api.get('/api/reports');
                setPages(pagesRes.data);
                setLeads(leadsRes.data);
                setReports(reportsRes.data);
            } catch (err) {
                console.error('Error fetching user data:', err);
            } finally {
                setLoading(false);
            }
        };
        fetchData();
    }, []);

    if (loading) return <div>Đang tải...</div>;

    return (
        <div className="user-content">
            <h1>User Dashboard</h1>
            <section>
                <h2>Quản lý Landing Page</h2>
                <table>
                    <thead>
                    <tr>
                        <th>Title</th>
                        <th>Status</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {pages.map((page) => (
                        <tr key={page._id}>
                            <td>{page.title}</td>
                            <td>{page.status}</td>
                            <td><button>Xem trước</button> <button>Triển khai</button></td>
                        </tr>
                    ))}
                    </tbody>
                </table>
                <button>Tạo mới</button>
            </section>
            <section>
                <h2>Quản lý Leads</h2>
                <table>
                    <thead>
                    <tr>
                        <th>Email</th>
                        <th>Phone</th>
                        <th>Source</th>
                    </tr>
                    </thead>
                    <tbody>
                    {leads.map((lead) => (
                        <tr key={lead._id}>
                            <td>{lead.email}</td>
                            <td>{lead.phone}</td>
                            <td>{lead.source}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </section>
            <section>
                <h2>Báo cáo</h2>
                <p>View Count: {reports.view_count}</p>
                <p>Lead Count: {reports.lead_count}</p>
                <button>Export</button>
            </section>
            <section>
                <h2>Thanh toán & Premium</h2>
                <p>Gói hiện tại: Free</p>
                <button>Nâng cấp Premium</button>
            </section>
            <section>
                <h2>Quảng cáo & Marketing</h2>
                <form>
                    <input placeholder="Subject" />
                    <textarea placeholder="Content" />
                    <button>Gửi Email</button>
                </form>
            </section>
            <section>
                <h2>Tương tác Khách hàng</h2>
                <button>Quản lý Chatbot</button>
            </section>
        </div>
    );
};

export default React.memo(UserDashboardContent);
